sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var tickets=[];
var gr= new GlideRecord("task");
gr.addActiveQuery();
gr.addQuery("assignment_group",inputs.parameter);
gr.query();
while(gr.next()){
    tickets.push({
        number: gr.number.toString(),
        sys_id: gr.sys_id.toString()
        });
    }
    outputs.ticket=tickets;
})(inputs, outputs);

